import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { bookingAPI, getImageURL } from '../../services/api';
import './Dashboard.css';

function Dashboard({ user }) {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (!user) {
      navigate('/login');
      return;
    }
    fetchBookings();
  }, [user, navigate]);

  const fetchBookings = async () => {
    try {
      const response = await bookingAPI.getUserBookings();
      if (response.data.success) {
        setBookings(response.data.data);
      } else {
        setError(response.data.message || 'Failed to fetch bookings');
      }
    } catch (err) {
      console.error('Error fetching bookings:', err);
      setError('Error loading your bookings');
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (status) => {
    switch(status) {
      case 'pending': return 'status-pending';
      case 'confirmed': return 'status-confirmed';
      case 'completed': return 'status-completed';
      case 'cancelled': return 'status-cancelled';
      default: return 'status-default';
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const formatTime = (timeString) => {
    return timeString.slice(0, 5);
  };

  if (loading) {
    return (
      <div className="dashboard-container">
        <div className="loading-container">
          <div className="loader"></div>
          <p>Loading your bookings...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <div className="dashboard-content">
        {/* Header */}
        <div className="dashboard-header">
          <div className="header-left">
            <button onClick={() => navigate('/')} className="back-btn">
              ‚Üê Back to Home
            </button>
            <h1>My Bookings</h1>
            <p className="welcome-text">
              Welcome back, {user?.username || user?.full_name || 'User'}!
            </p>
          </div>
          <div className="header-right">
            <div className="booking-count">
              <span className="count-label">Total Bookings</span>
              <span className="count-number">{bookings.length}</span>
            </div>
          </div>
        </div>

        {/* Error Message */}
        {error && (
          <div className="error-banner">
            <span>‚ö†Ô∏è</span>
            <p>{error}</p>
          </div>
        )}

        {/* Bookings List */}
        {bookings.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">üì¶</div>
            <h2>No Bookings Yet</h2>
            <p>You haven't made any bookings. Start exploring our beautiful artworks!</p>
            <button onClick={() => navigate('/')} className="browse-btn">
              Browse Artworks
            </button>
          </div>
        ) : (
          <div className="bookings-grid">
            {bookings.map((booking) => (
              <div key={booking.booking_id} className="booking-card">
                {/* Artwork Image */}
                <div className="booking-image">
                  <img 
                    src={getImageURL(booking.image_url)} 
                    alt={booking.artwork_title}
                    onError={(e) => {
                      e.target.src = 'https://via.placeholder.com/300x200?text=Artwork';
                    }}
                  />
                  <div className="image-overlay">
                    <span className={`status-badge ${getStatusColor(booking.status)}`}>
                      {booking.status.charAt(0).toUpperCase() + booking.status.slice(1)}
                    </span>
                  </div>
                </div>

                {/* Booking Details */}
                <div className="booking-details">
                  <div className="booking-header">
                    <h3>{booking.artwork_title}</h3>
                    <p className="booking-id">ID: #{booking.booking_id}</p>
                  </div>

                  <div className="details-grid">
                    {/* Customer Info */}
                    <div className="detail-section">
                      <h4>
                        <span className="icon">üë§</span>
                        Customer Details
                      </h4>
                      <div className="detail-item">
                        <span className="label">Name:</span>
                        <span className="value">{booking.customer_name}</span>
                      </div>
                      <div className="detail-item">
                        <span className="label">Email:</span>
                        <span className="value">{booking.email}</span>
                      </div>
                      <div className="detail-item">
                        <span className="label">Phone:</span>
                        <span className="value">{booking.phone}</span>
                      </div>
                    </div>

                    {/* Delivery Info */}
                    <div className="detail-section">
                      <h4>
                        <span className="icon">üöö</span>
                        Delivery Details
                      </h4>
                      <div className="detail-item">
                        <span className="label">Date:</span>
                        <span className="value">{formatDate(booking.preferred_date)}</span>
                      </div>
                      <div className="detail-item">
                        <span className="label">Time:</span>
                        <span className="value">{formatTime(booking.preferred_time)}</span>
                      </div>
                      <div className="detail-item">
                        <span className="label">Address:</span>
                        <span className="value">{booking.delivery_address}</span>
                      </div>
                    </div>
                  </div>

                  {/* Special Instructions */}
                  {booking.special_instructions && (
                    <div className="special-instructions">
                      <h4>
                        <span className="icon">üìù</span>
                        Special Instructions
                      </h4>
                      <p>{booking.special_instructions}</p>
                    </div>
                  )}

                  {/* Footer */}
                  <div className="booking-footer">
                    <div className="footer-left">
                      <span className="booked-date">
                        Booked on {formatDate(booking.created_at)}
                      </span>
                    </div>
                    <div className="footer-right">
                      <span className="price-label">Total Amount</span>
                      <span className="price-value">
                        ‚Çπ{booking.total_amount.toLocaleString()}
                      </span>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
